import React, { Component } from 'react';
import '../../../styles/login.css'
import {postService} from "../../../services/services";
import {Routes} from "../../../services/routes";



class LogIn extends Component {

    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
            message:'',
        }
    }

    handleValidate() {
        return this.state.username !== '' && this.state.password !== '';
    }

    handleLogin = (e) => {
        e.preventDefault();
        this.handleValidate() ? this.sendLogin() : this.showErrorMesage();
    };


    showErrorMesage(){
        this.setState({
            message: 'incorrecto'
        });
        console.log('falta usuario y/o contraseña')
    }


    sendLogin() {
        let headers = {
            'Content-Type': 'application/json'
        };

        let body = {
            username: this.state.username,
            password: this.state.password,
        };

        postService(Routes.LOGIN, body, headers).then(data => {
            console.log(data)
            if(data.token !== null) {
                localStorage.setItem("@websession", data.token);
                this.props.CheckLocalStorage();
            }else if(data.error === ''){
                this.setState({
                    message: data.error,
                });
                console.log(data.error)
            }
        })
    }

    render() {
        return (
            <div className="wrapper fadeInDown">
                <div id="formContent">

                    <h2 className="active"> Sign In</h2>


                    <div className="fadeIn first">
                        <img src="data:image/png;base64," id="icon" alt="User Icon"/>
                    </div>


                    <form onSubmit={this.handleLogin}>
                        <input type="text" className="fadeIn second"
                               placeholder="email"
                               value={this.state.username}
                               onChange={(e) => this.setState({
                                   username: e.target.value
                               })}
                        />
                        <input type="password" id="password" className="fadeIn third"
                               placeholder="contraseña"
                               value={this.state.password}
                               onChange={(e) => this.setState({
                                   password: e.target.value
                               })}
                        />
                        <input type="submit" className="fadeIn fourth" value="Iniciar sesion"/>
                    </form>
                </div>
            </div>
        );
    }
}

export default LogIn;
